export const add = (...args) => console.log(args.reduce((a, b) => a + b));
export const subtract = (...args) => console.log(args.reduce((a, b) => a - b));
export const multiply = (...args) => console.log(args.reduce((a, b) => a * b));
export const divide = (...args) => console.log(args.reduce((a, b) => a / b));
